import { Slide } from 'react-slideshow-image';

const slideImages = [
  "https://www.seriouseats.com/thmb/VJipLV8zrG-EB9PAeeOHEKf7LPM=/1088x0/filters:no_upscale():max_bytes(150000):strip_icc():format(webp)/__opt__aboutcom__coeus__resources__content_migration__serious_eats__seriouseats.com__images__2011__08__20110812-murrays-cheese-taleggio-01-238109aed72e474db3052129d752c114.jpg",
  'https://www.seriouseats.com/thmb/VJipLV8zrG-EB9PAeeOHEKf7LPM=/1088x0/filters:no_upscale():max_bytes(150000):strip_icc():format(webp)/__opt__aboutcom__coeus__resources__content_migration__serious_eats__seriouseats.com__images__2011__08__20110812-murrays-cheese-taleggio-01-238109aed72e474db3052129d752c114.jpg',
  "https://www.seriouseats.com/thmb/fGivL4LlQrwgCHxxyNTujTqpx8k=/1088x0/filters:no_upscale():max_bytes(150000):strip_icc():format(webp)/__opt__aboutcom__coeus__resources__content_migration__serious_eats__seriouseats.com__images__20110812-murrays-cheese-gouda-01-03d16f2b638b43a4b792080866f601ee.jpg",
];

const SlideShow = () => {
    return (
      <div>
        <Slide easing="ease">
          <div className="each-slide">
            <img src= {slideImages[0]}/>

          </div>
          <div className="each-slide">
            <div style={{'backgroundImage': `url(${slideImages[1]})`}}>
              <span>Slide 2</span>
            </div>
          </div>
          <div className="each-slide">
            <div style={{'backgroundImage': `url(${slideImages[2]})`}}>
              <span>Slide 3</span>
            </div>
          </div>
        </Slide>
      </div>
    )
};

export default SlideShow;
